import React, { Component } from 'react'

class GeneralInfo extends Component {
    constructor(props) {
      super(props)


    }


  render() {
      const {handleInput,handleInputLn,handleInputTt,handleInputAd,handleInputPn,handleInputMail,handleInputDesc} = this.props;
    return (
      <div>
          <h3>Personal information</h3>
          <input placeholder='First Name' onInput={handleInput}></input>
          <input placeholder='Last Name' onInput={this.props.handleInputLn}></input>
          <input placeholder='Title' onInput={this.props.handleInputTt}></input>
          <input placeholder='Address' onInput={this.props.handleInputAd}></input>
          <input placeholder='Phone number' onInput={this.props.handleInputPn}></input>
          <input placeholder='Email' onInput={this.props.handleInputMail}></input>
          <input placeholder='Description' onInput={this.props.handleInputDesc}></input>

      </div>
    )
  }
}

export default GeneralInfo
